INSERT INTO `v1_0507efba495fbe4171c7121b95c9bd87fdbe15f61cec92b983257012c0b3eeab` VALUES (6, 11601, 0.625, 1, "ツムギのボトルキャップ", 0.75, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。");
